__NUXT_JSONP__("/products/detail/cf72a416-ae7d-4ac7-8055-a75c5baa66d8", (function(a,b,c){return {data:[{}],fetch:{"0":{detail:{id:"cf72a416-ae7d-4ac7-8055-a75c5baa66d8",name:b,route:c,pic:"uploads\u002F1907c30fdd3f4764454198e641e62f971634366912351.jpg",category:"d7bddc18-4640-45bd-9511-914e5a429091",intro:c,content:"\u003Cp\u003EOpera 80 稳定版\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;Kornelia Mielczarczyk 2021 年 10 月 5 日 92 条评论\u003C\u002Fp\u003E\u003Cp\u003E你好歌剧迷。\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E我们很高兴地通知 Opera 80 到达稳定分支！\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E此版本包含阅读器模式选项，可作为地址栏中的书本图标使用。 您可以根据需要打开和关闭此模式，使网页更干净、更易于阅读。\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EOpera 80 基于 Chromium 94（准确地说是这个版本的 94.0.4606.61 ;)）。 更改日志中提供了所有更改。\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E注意：此版本还包含针对 CVE-2021-37975、CVE-2021-37976 和 CVE-2021-37974 的修复，这些修复最初包含在 Chromium 版本 94.0.4606.71 中。\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E浏览愉快！\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E安装链接：\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E适用于 Windows 的 Opera 稳定版\u003C\u002Fp\u003E\u003Cp\u003E适用于 macOS 的 Opera 稳定版\u003C\u002Fp\u003E\u003Cp\u003E适用于 Linux 的 Opera Stable – deb 包\u003C\u002Fp\u003E\u003Cp\u003E适用于 Linux 的 Opera Stable – RPM 包\u003C\u002Fp\u003E\u003Cp\u003E适用于 Linux 的 Opera Stable – snap 包\u003C\u002Fp\u003E",recommend:a,status:a,updatedAt:"2021-10-21T09:15:36.000Z"},items:[{text:"首页",href:"\u002F"},{text:"产品展示",active:a},{text:b,active:a}]}},mutations:[]}}(true,"Opera 80 稳定版","")));